import React, { Component } from 'react'
import UserItem from './UserItem'

export default class Conectados extends Component {
    render() {
        return (
            <div className="col-2 flex-column float-lg-right float-md-right float-xl-right border bg-white m-0 p-0">

                <UserItem />

            </div>
        )
    }
}
